import Head from 'next/head';
import AppointmentForm from '../components/AppointmentForm';
import Benefits from '../components/Benefits';
import CatchLine from '../components/CatchLine';
import Doctors from '../components/Doctors';
import Footer from '../components/Footer';
import Product from '../components/Product';
import Warning from '../components/Warning';

const Home: React.FC = () => {
  return (
    <>
      <Head>
        <title>Bentcare | Home</title>
      </Head>
      <Warning>
        <p>Agende exames e consultas em até 12x sem juros</p>
      </Warning>
      <CatchLine>
        Os melhores preços em consultas e exames laboratoriais
      </CatchLine>
      <AppointmentForm />
      <CatchLine>Tudo que você precisa tem aqui na BentCare</CatchLine>
      <Product />
      <Benefits />
      <Doctors />
      <Footer />
    </>
  );
};

export default Home;
